import React from 'react';
import './FilterBar.css';

const FilterBar = () => {
  const filters = [
    'Filter 1',
    'Filter 2',
    'Filter 3',
    'Filter 4',
    'Filter 5',
  ];

  return (
    <div className="filter-bar">
    <h3>Filters</h3>
      {filters.map((filter, index) => (
        <div key={index} className="filter">
          {filter}
        </div>
      ))}
    </div>
  );
};

export default FilterBar;
